$scope.generarpqtPorEntregar= function() {


  var base64Img = null;

  
    // Returns a new array each time to avoid pointer issues
    var getColumns = function () {
        return [
            {title: "Cliente", dataKey: "cliente"},
            {title: "Cerrado (g)", dataKey: "cerrado"},
            {title: "Entregado (g)", dataKey: "entregado"},
            {title: "Pendiente (g)", dataKey: "pendiente"},
            {title: "Fecha Última Entrega", dataKey: "fecha_ultima_entrega"}
        ];
    };

    function imgToBase64(url, callback) {
      if (!window.FileReader) {
          callback(null);
          return;
      }
      var xhr = new XMLHttpRequest();
      xhr.responseType = 'blob';
      xhr.onload = function() {
          var reader = new FileReader();
          reader.onloadend = function() {
              callback(reader.result.replace('text/xml', 'image/jpeg'));
          };
          reader.readAsDataURL(xhr.response);
      };
      xhr.open('GET', url);
      xhr.send();
    }

    imgToBase64('aurelis.jpg', function(base64) {
        base64Img = base64;
    }); 

    base64Img ="data:image/jpeg;base64,";
       
    $http.get("clientes/")
                .success(function(clientes){
                  //console.log(clientes);
                
  
       var doc = new jsPDF();
       var totalPagesExp = "{total_pages_count_string}";
/***********************************Contenido del PDF******************************************************************/
         var pageContent = function (data) {
              // HEADER
              
              doc.setFontSize(20);
              doc.setTextColor(40);
              doc.setFontStyle('normal');
              if (base64Img) {
                  doc.addImage(base64Img, 'JPEG', data.settings.margin.left,5, 30, 30);
              }
              //doc.text("Cliente", data.settings.margin.left + 35, 22);
              doc.text("REPORTE DE ENTREGA PENDIENTE", 55, 23);
              doc.setFontSize(15);
              //doc.text("Cliente: "+clientes[0].nombres+' '+clientes[0].apellidos, data.settings.margin.left + 45, 30);
              doc.text("___________________________________________________________________________________________________", 0, 35);
              doc.text("___________________________________________________________________________________________________", 0, 36);
              doc.setFontSize(12);
              //doc.text("Datos de la Entrega", 14,45);
              // FOOTER
              var str = "Página " + data.pageCount;
              // Total page number plugin only available in jspdf v1.0+
              if (typeof doc.putTotalPages === 'function') {
                  str = str + " de " + totalPagesExp;
              }
              doc.setFontSize(10);
              doc.text(str, data.settings.margin.left, doc.internal.pageSize.height - 10);
    };
/***********************************Contenido del PDF******************************************************************/
/***********************************Seccion de Entregas Pendientes****************************************************************/  
    var data = [];
    var pendiente=0;
    var ultima_entrega;
    for (var i = 0; i < clientes.length; i++) {
      if ((clientes[i].cerrado != 0)&&(clientes[i].cerrado != null)&&(((clientes[i].cerrado) - (clientes[i].entregado))>0)){

        pendiente-= parseFloat(clientes[i].entregado - clientes[i].cerrado).toFixed(2); 

        if(!clientes[i].ultima_entrega){
           ultima_entrega='' ;
        }
        else{
          ultima_entrega= moment(clientes[i].ultima_entrega).format('DD-MM-YYYY');
        }
        data.push({
            cliente: clientes[i].nombres +' '+ clientes[i].apellidos,
            cerrado: clientes[i].cerrado,
            entregado: parseFloat(clientes[i].entregado).toFixed(2),
            pendiente: parseFloat(clientes[i].entregado - clientes[i].cerrado).toFixed(2),
            fecha_ultima_entrega: ultima_entrega
        });
      }
   }
   doc.autoTable(getColumns(), data, {
        addPageContent: pageContent,
        margin: {top: 45},
        headerStyles: {
          halign: 'center'
        },
        bodyStyles: {
          halign: 'center'
        },
        columnStyles: {
          halign: 'center'
        }
    });
    doc.setFontSize(12);
    doc.text('Total Pendiente: - '+ parseFloat(pendiente).toFixed(2) + ' (g)', 14, doc.autoTable.previous.finalY + 10);
/***********************************Seccion de Entregas Pendientes****************************************************************/

    // Total page number plugin only available in jspdf v1.0+
    if (typeof doc.putTotalPages === 'function') {
        doc.putTotalPages(totalPagesExp);
    } 


      
    //    doc.save('Reporte por Entregar.pdf');

     doc.output('datauri');

    });
             
}

